import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header style={{
      backgroundColor: '#f7f4f6ff',
      color: 'white',
      padding: '15px 20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      flexWrap: 'wrap'
    }}>
      <Link to="/admin-login">
        <button style={{
          backgroundColor: '#FFA500',
          color: '#000',
          border: 'none',
          borderRadius: '5px',
          padding: '10px 15px',
          cursor: 'pointer',
          fontWeight: 'bold'
        }}>
          Admin Orders
        </button>
      </Link>
    </header>
  );
}

export default Header;
